import{createInstance}from"../../keyword/create-instance.min.js";import{Buildable}from"../../interface/buildable.min.js";import{DatabaseExperienceGraphModel}from"../../model/graph/database-experience-graph-model.min.js";import{Utility}from"../../shared/utility.min.js";import{PageColorAdjuster}from"../../shared/page-color-adjuster.min.js";import ScriptSeriesLoader from"../../shared/script-series-loader.min.js";class DatabaseExperienceGraphController extends Buildable{constructor(){super(),this.model=new DatabaseExperienceGraphModel,this.scriptLoader=ScriptSeriesLoader,this.scriptLoader.add("https://cdn.plot.ly/plotly-latest.min.js"),this.scriptLoader.load()}static build=async()=>{const e=new DatabaseExperienceGraphController;for(;e.scriptLoader.running;)await Utility.sleep(2e3);return e};execute=async()=>{const e=(new DatabaseExperienceGraphModel).getDatabaseExperience(),a=[];for(const r in e)a.push({label:r,value:e[r]});a.sort(((e,a)=>a.value-e.value));const r=[{values:a.map((e=>e.value)),labels:a.map((e=>e.label)),type:"pie"}];Plotly.newPlot("graph-container",r,{title:"データベース経験"});(await createInstance(PageColorAdjuster)).changeBackgroundColor(),$("body").addClass("loaded")}}export{DatabaseExperienceGraphController};